<!DOCTYPE html><html lang="{{ site.lang | default: " en-us"="" }}"=""><head>
    <meta charset="utf-8"/>
    <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
    <meta name="viewport" content="width=device-width, initial-scale=1"/>
    <link rel="stylesheet" href="{{ &#39;/assets/css/style.css?v=&#39; | append: site.github.build_revision | relative_url }}"/>
    <link rel="shortcut icon" type="image/png" href="images/favicon.png"/>

</head><body>{% seo %}
  

  
    <header>
      <div class="container">
        <a id="a-title" href="{{ &#39;/&#39; | relative_url }}">
          <h1>{{ site.title | default: site.github.repository_name }}</h1>
        </a>
        <a class="dashingAutolink" name="autolink-0"></a><a class="dashAnchor" name="//apple_ref/cpp/Type/%7B%7B%20site.description%20%7C%20default%3A%20site.github.project_tagline%20%7D%7D"></a><h3>{{ site.description | default: site.github.project_tagline }}</h3>
      </div>
    </header>

    <div class="container">
      <section id="main_content">
        {{ content }}
      </section>
    </div>

    {% if site.google_analytics %}
      <script>
        (function(i,s,o,g,r,a,m){i['GoogleAnalyticsObject']=r;i[r]=i[r]||function(){
        (i[r].q=i[r].q||[]).push(arguments)},i[r].l=1*new Date();a=s.createElement(o),
        m=s.getElementsByTagName(o)[0];a.async=1;a.src=g;m.parentNode.insertBefore(a,m)
        })(window,document,'script','//www.google-analytics.com/analytics.js','ga');
        ga('create', '{{ site.google_analytics }}', 'auto');
        ga('send', 'pageview');
      </script>
    {% endif %}
  


{% include footer.html %}
<p>default default default default</p></body></html>
